DROP DATABASE IF EXISTS collegeCompass;
CREATE DATABASE collegeCompass;

USE collegeCompass;

grant all privileges on collegeCompass.* to 'webapp'@'%';
flush privileges;

DROP TABLE IF EXISTS Students;

CREATE TABLE Students(
   StudentID    INT  NOT NULL PRIMARY KEY
  ,SchoolID     INT  NOT NULL
  ,CounselorID  INT  NOT NULL
  ,FirstName    VARCHAR(20) NOT NULL
  ,LastName     VARCHAR(20) NOT NULL
  ,Email        VARCHAR(50) NOT NULL
  ,Year         INT  NOT NULL
  ,DesiredMajor VARCHAR(50) NOT NULL
  ,DesiredMinor VARCHAR(50) NOT NULL
  ,SAT          INT  NOT NULL
  ,ACT          INT  NOT NULL
  ,GPA          FLOAT NOT NULL
  ,PhoneNumber  BIGINT  NOT NULL
);

DROP TABLE IF EXISTS HighSchool;

CREATE TABLE HighSchool(
   SchoolName VARCHAR(100) NOT NULL
  ,Size       INT  NOT NULL
  ,SchoolRank INT  NOT NULL
  ,SchoolID   INT  NOT NULL PRIMARY KEY
);

DROP TABLE IF EXISTS Counselors;

CREATE TABLE Counselors(
   FirstName   VARCHAR(20) NOT NULL
  ,LastName    VARCHAR(20) NOT NULL
  ,CounselorID INT  NOT NULL PRIMARY KEY
);

DROP TABLE IF EXISTS College;

CREATE TABLE College(
   CollegeName    VARCHAR(51) NOT NULL
  ,EnrollmentSize INT  NOT NULL
  ,AcceptanceRate VARCHAR(4) NOT NULL
  ,CollegeID      INT  NOT NULL PRIMARY KEY
);


DROP TABLE IF EXISTS Departments;

CREATE TABLE Departments(
   DeptCode        INT  NOT NULL PRIMARY KEY
  ,CollegeID       INT  NOT NULL
  ,DeptRank        INT  NOT NULL
  ,DeptDescription VARCHAR(626) NOT NULL
);

DROP TABLE IF EXISTS Courses;

CREATE TABLE Courses(
   CourseID          VARCHAR(11) NOT NULL
  ,DeptCode          INT  NOT NULL
  ,Credits           INT  NOT NULL
  ,CourseName        VARCHAR(25) NOT NULL
  ,CourseDescription VARCHAR(649) NOT NULL
  ,PRIMARY KEY(CourseID,DeptCode)
);

DROP TABLE IF EXISTS Parents;

CREATE TABLE Parents(
   Name           VARCHAR(19) NOT NULL PRIMARY KEY
  ,StudentID      INT  NOT NULL
  ,Income         INTEGER  NOT NULL
  ,SchoolAttended VARCHAR(51) NOT NULL
  ,NumChildren    INT  NOT NULL
);

-- Creating the Financial Package Table
DROP TABLE IF EXISTS FinancialPackage;
CREATE TABLE FinancialPackage
(
    FFCode INT,
    CollegeID INT,
    LowerRange INT NOT NULL,
    UpperRange INT NOT NULL,
    AmountOfAid FLOAT NOT NULL,
    NumSemesters INT NOT NULL,
    CONSTRAINT financialPackagePK PRIMARY KEY (FFCode, CollegeID),
    CONSTRAINT financialPackageFK FOREIGN KEY (CollegeID) REFERENCES College(CollegeID)
        ON UPDATE CASCADE
        ON DELETE CASCADE
);

