-- Creating the Scholarships Table
DROP TABLE IF EXISTS Scholarships;
CREATE TABLE Scholarships
(
    SSCode INT,
    FFCode INT,
    ScholarshipName VARCHAR(50) NOT NULL,
    ScholarshipDescription TEXT,
    Amount FLOAT NOT NULL,
    CONSTRAINT financialPackagePK PRIMARY KEY (SSCode, FFCode),
    CONSTRAINT scholarshipsFK FOREIGN KEY (FFCode) REFERENCES FinancialPackage(FFCode)
        ON UPDATE CASCADE
        ON DELETE CASCADE
);

