-- Creating the StudentColleges Table
DROP TABLE IF EXISTS StudentColleges;
CREATE TABLE StudentColleges
(
    CollegeID INT,
    StudentID INT,
    SAT INT,
    ACT INT,
    Accepted VARCHAR(5),
    Rejected VARCHAR(5),
    Waitlisted VARCHAR(5),
    CONSTRAINT stuColPK PRIMARY KEY (CollegeID, StudentID),
    CONSTRAINT stuColFK1 FOREIGN KEY (StudentID) REFERENCES Students(StudentID)
        ON UPDATE CASCADE
        ON DELETE CASCADE,
    CONSTRAINT stuColFK2 FOREIGN KEY (CollegeID) REFERENCES College(CollegeID)
        ON UPDATE CASCADE
        ON DELETE CASCADE
);

