-- Creating the AlumChatContent Table
DROP TABLE IF EXISTS AlumChatContent;
CREATE TABLE AlumChatContent
(
    Content VARCHAR(255),
    StudentID INT,
    AlumniID INT,
    CONSTRAINT alumChatContentPK PRIMARY KEY (StudentID, AlumniID, Content),
    CONSTRAINT alumChatContentFK FOREIGN KEY (StudentID, AlumniID) REFERENCES AlumniChats(StudentID, AlumniID)
        ON UPDATE CASCADE
        ON DELETE CASCADE
);

